import React from 'react'
import { useNavigate } from 'react-router'
import "../styles/main.css"
function Banner() {

    let history = useNavigate()

    const priceRedirect = () => {
        history("/price")
    }

    const placeHolder = () => {
        history("/placeholder")
    }
    const myComponentStyle = {

        padding: '1.5em',

     }

    return (
            <div className="position-absolute top-50 start-50 translate-middle text-bg-dark p-1"> 
                <div className="h1 fw-bolder text-center" > <strong>AutoWatch</strong> </div>
                <div className="banner_title_tail">
                    <div className="h4">A Machine Learning based Web Application for market price recommendation of cars</div>

                </div>
                <div className="banner__buttons text-center col-xs-3">
                        <button onClick={priceRedirect} type="button" class="btn btn-outline-dark btn-lg" 
                        style={myComponentStyle}>Price Recommender</button>
                        <button onClick={placeHolder} type="button" class="btn btn-outline-dark btn-lg">Place Holder</button>

                </div>

            </div>
    )
}

export default Banner
